node.text:
Flashback to my epic 29th birthday celebration! Putting this party together was SO fun and such a collaborative effort. It turned out so amazing and I am so grateful for everyone that played a part in making it happen! I also want to thank my amazing guests for coming out to help me celebrate. I feel so loved! 

Thank you so much!:

 Joe for letting me have my party at @vineyardhacienda Such an incredibly unique and beuatufl venue! I will be back for many staycations!

@fady_events for the epic all the lights and sparkler towers and strobes and everything that made the party what it was! You are epic and i never want to throw a party without you being involved! 

@joshcoefield and @beaumaitred for being my point man and party planner! You were epic and I couldn’t have done it without you!

@wahurley the delicious appetizers and @chebahut_sd for providing bomb ass sandwiches!

@pinkpaisleycakes for the beautiful birthday cake and cupcakes! 

@iamnoel.media for DJing and bumping the tunes and keeping my guests on the dance floor!

@dulcevidatequila for the amazing birthday cocktails and shots! AMAZING

@hiwi.decor.balloons for the decorations! 

@rex.images.art and @shotzbyed and @oscardegarza for documenting the night. I now have beautiful videos and photos to look back at and remember my night! Thank youuuu @connordever for this video!

@alexjohnsonsd for being my manager and helping everything go smoothly! 🙌 you are appreciated 

@slandscreative for putting together my flyer and helping me with odds and ends -you are so talented I am lucky to call you my friend!

@bradbrenk for being an epic co host and my honey for life

And last but not least my glam team!! Thanks for making me flawless for my special evening, @saltybeachtanandlashbar for the best spray tan I’ve ever had, @holdentimelessbeautymedspa for my birthday week prep, @beautybyhenda for my hair, and @kelsey_long_artistry for slaying my makeup! I love all of you!!

🤍The human heart has hidden treasures, in secrets kept, in silence sealed; the thoughts, the hopes, the dreams, the pleasures, whose charms were broken if revealed. 🤍

Simplicity is the ultimate form of sophistication 

@lifeofthepartymedia

If you need me, you can just find me by the pool bar 🤷🏻‍♀️😏 

Happy Sunday cuties 

@bobbyhotel @saltybeachtanbar @lifeofthepartymedia
